import React from 'react';
import './Header.css'; 
import SearchBar from './SearchBar';


const Header = ({onRouteChange, isSignedIn}) => {
	return (
		<header >
			<div className='background-image-container'>
			<SearchBar />
				<div className="placeholder">
				</div>
			</div>			
	    </header>
	);
}

export default Header;
